import React from 'react';
import {data} from "./store/store.jsx"
import Product from "./components/productcart/Product"
import logo from './logo.svg';
import './App.css';




class App extends React.Component {
    constructor() {
        super();

        this.state = {
            qty: data
        }
    }

    removeElement (movie){
        const newList = this.state.qty.filter(function (item){
            return item.id !== movie.id
        })
    }




    render() {
        return (
            <div>
                {this.state.qty.map(function (el) {
                    return (
                        <div>
                            <Product el={el} removeElement1={this.removeElement} />
                        </div>
                    )
                })}
            </div>
        )
    }


}


export default App;
